                        <section class="additional-row bg-grey-lighter" id="what-is-margin" data-track-view="what-is-margin">
                            <div class="grid-container">
                                <div class="row">
                                    <div class="grid-100 content">
                                        <div class="row">
                                            <div class="v-aligner mobile-unalign tablet-unalign">
                                                <div class="grid-50 v-align">
                                                    <h2>What is Margin?</h2>
                                                    <p>In finance, the margin is the collateral that an investor has to deposit with their broker or exchange to cover the credit risk the holder poses for the broker or the exchange. An investor can create credit risk if they borrow cash from the broker to buy financial instruments, borrow financial instruments to sell them short, or enter into a derivative contract.</p>
                                                    <p>{{$settings->site_name}}  Trading Limited accounts utilize a Tiered Margin system which consists of an Entry / Maintenance margin and a Liquidation margin.</p>
                                                    <p>
                                                        <strong>Entry / Maintenance Margin</strong> – The initial good faith deposit or collateral set aside to open and then maintain a position. On the Trading Station platform the exact amount of margin required to open a position can be viewed in the "MMR" column under the "Simple Dealing Rates" tab or in the "Used Maint Mr" column under the "Accounts" tab -
                                                    </p>
                                                    <p>
                                                        <strong>Liquidation Margin (Minimum Required Margin)</strong> - Generally 50% of the Entry Margin, If your account equity falls below this level, all positions are closed.
                                                    </p>
                                                    <p>
                                                    </p>
                                                </div>
                                                <div class="grid-50 v-align">
                                                    <img src="data:image/png;base64," class="grid-center fxcm-image" alt="Simple Dealing Rates">
