                        <section class="additional-row" id="the-tiered-margin-watcher" data-track-view="the-tiered-margin-watcher">
                            <div class="grid-container">
                                <div class="row">
                                    <div class="grid-100 content">
                                        <h2>The Tiered Margin Watcher</h2>
                                        <p>{{$settings->site_name}} 's Tiered Margin Watcher is designed to notify you in advance of margin calls, which can give you more time to take action to potentially avoid them. Watch the video to find out more, or check out our
                                        </p>
                                    </div>
                                </div>
                            </div>
                        </section>
                        <section class="additional-row bg-grey-lighter" id="do-margin-requirements-change" data-track-view="do-margin-requirements-change">
                            <div class="grid-container">
                                <div class="row">
                                    <div class="grid-100 content">
                                        <h2>Do Margin requirements change?</h2>
                                        <p>Margin requirements can periodically change to account for changes in market volatility and currency exchange rates. For example, the margin requirement (MMR) for a specific currency pair is calculated as a percentage of the notional value of such pair. As the exchange rates for any specific currency pair fluctuate up or down, the margin requirement for that pair must be adjusted. As an example, if the Euro strengthens against the US dollar, more margin will be required to hold a EUR/USD position in a US dollar denominated account. {{$settings->site_name}}  Trading Limited does not anticipate more than one update a month, however extreme market movements or event risk may necessitate unscheduled intra-month updates.</p>
                                        <div class="row">
                                            <div class="grid-100">
                                                <p>The Trading Station tiered margin system consists of two components:</p>
                                                <ol>
                                                    <li>
                                                        <strong>Initial Entry/Maintenance Margin</strong> – The initial good faith deposit or collateral set aside to open and then maintain a position. The exact amount of margin required to open a position can be viewed in the "MMR" column under the "Simple Dealing Rates" tab on the Trading Station platform or in the "Used Maint Mr" column under the "Accounts" on the Trading Station platform.
                                                    </li>
                                                    <li>
                                                        <strong>Liquidation Margin (Minimum Required Margin)</strong> – The minimum amount of equity that must be in the account in order to continue holding the current open positions on the account. This is set at 50% of the value of the Maintenance Margin. If the account equity falls below this level, all positions will be automatically closed. The exact amount of margin required before automatic liquidation will occur can be found in the "Used Mr" column under the "Accounts" tab on the Trading Station platform.
                                                    </li>
                                                </ol>
                                            </div>
                                        </div>
                                    </div>
                                </div>
                            </div>
                        </section>
                        <section class="additional-row" id="mt4-tiered-margin" data-track-view="mt4-tiered-margin">
                            <div class="grid-container">
                                <div class="row">
                                    <div class="grid-100 content">
                                        <h2>MetaTrader 4 (MT4) Tiered Margin</h2>
                                        <p>Similar to Trading Station II accounts, MetaTrader 4 (MT4) accounts are defaulted to a tiered margin system. MT4 accounts do not use the Smart Margin system, but use a different version of {{$settings->site_name}} 's tiered margin and margin call procedures. The MT4 Tiered Margin system is designed to allow clients more time in which to manage their positions before the automatic liquidation of those positions occurs. Clients are able to see real-time updates of their margin status on the MT4 platform.</p>
                                        <p>The MT4 platform does not allow {{$settings->site_name}}  Trading Limited to include commissions in pre-trade margin calculations on client's pending orders. This means that if you place a trade with a small amount of available usable margin under the MT4 account, there is a risk that the execution of the orders could trigger immediate margin call right after the execution as the commission charges can result in insufficient margin to maintain your open positions. You should therefore ensure that you have reserved sufficient buffer usable margin before opening new trades.</p>
                                        <p>The MT4 Tiered Margin system consists of two components:</p>
                                        <ol>
                                            <li>
                                                <strong>Entry / Maintenance Margin</strong> – The initial good faith deposit or collateral set aside to open and then maintain a position. The exact amount of margin required to open a position can be viewed in the "MMR" column under the "Simple Dealing Rates" tab on the Trading Station platform prior to execution or by viewing the label "Margin" under the "Trade" tab in the MT4 platform.
                                            </li>
                                            <li>
                                                <strong>Liquidation Margin (Minimum Required Margin)</strong> – The minimum amount of equity that must be in the account in order to continue holding the current open positions on the account. This is set at 50% of the value of the Maintenance Margin and automatic liquidation will trigger when the "Margin Level" label under the "Trade" tab in the MT4 platform reads "50%" or below.
                                            </li>
                                        </ol>
                                    </div>
                                </div>
                            </div>
                        </section>
